import Header from "./composants/Header";
import { personne } from "./datas/data";

function App() {
  return (
    <div className="App">
        <ul>
            {personne.map((list)=>{
              <li>{list.nom}</li>
            })}          
        </ul>
        <Header />
    </div>
  );
}

export default App;
